import React from 'react';
import { Worker, Viewer } from '@react-pdf-viewer/core';
import '@react-pdf-viewer/core/lib/styles/index.css';

const Leitura = () => {
  // Certifique-se de fornecer uma versão válida do PDF.js
  const pdfjsWorker = `https://unpkg.com/pdfjs-dist@2.10.377/build/pdf.worker.min.js`;

  return (
    <div>
      <Worker workerUrl={pdfjsWorker}>
        <Viewer fileUrl="Original-Akin_Legado_de_um_povo.pdf" />
      </Worker>
    </div>
  );
};

export default Leitura;
